import React from "react";
import { Row, Col, Typography, Button } from "antd";
import {
  DownloadOutlined,
  MinusOutlined,
  PlusOutlined,
} from "@ant-design/icons";

const Counter = () => {
  const counter = 45;
  return (
    <React.Fragment>
      <Row justify='center'>
        <Typography.Title>Actividad de Contador</Typography.Title>
      </Row>
      <Row>
        <Col md={9} />
        <Col md={2}>
          <Button size="large" icon={<MinusOutlined />} shape="circle" />
        </Col>
        <Col md={2}>45</Col>
        <Col md={2}>
          <Button size="large" icon={<PlusOutlined />} shape="circle" />
        </Col>
      </Row>
    </React.Fragment>
  );
};

const mapStateToProps = state => ({conter: state.counter})

const mapDispatchToProps = dispatch => ({
  increment: () => {dispatch({type: 'INCREMENT'})},
  increment: () => {dispatch({type: 'DECREMENT'})},

})

export default Counter;
